import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Routes , Route} from "react-router-dom";
import Poster from './poster/poster';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element={<Poster/>}/>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
